import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { registerUser } from "../service";

const Login = () => {
  const [email, setemail] = useState("");
  const [name, setName] = useState("");
  const [password, setPassword] = useState("");
  const [Error, setError] = useState(false);
  const [Errormsg, setErrormsg] = useState("");
  const navigate = useNavigate();

  const _registerUser = async (e) => {
    e.preventDefault();
    var result = registerUser(name, email, password);
    result.then((response) => {
      if (response.status) {
        navigate("/login");
      } else {
        setError(true)
        setErrormsg(response.error);
      }
    });
  };

  const signIn = () =>{
    navigate("/login");
  }
  return (
    <form onSubmit={_registerUser}>
      <div>
        <label htmlFor="name">name</label>
        <input
          type="text"
          id="name"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
      </div>
      <div>
        <label htmlFor="email">Email</label>
        <input
          type="text"
          id="email"
          value={email}
          onChange={(e) => setemail(e.target.value)}
        />
      </div>
      <div>
        <label htmlFor="password">Password</label>
        <input
          type="password"
          id="password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />
      </div>
      {Error === true && (
          <>
            <div
              className="alert alert-danger fade show"
              role="alert"
            >
              <p className=" mb-0 text-start">{Errormsg}</p>
            </div>
          </>
        )}
      <button className="mt-6" type="submit">
        Register
      </button>
      <div className="text-center d-block forgot-btm-border pb-3">
                    <button
                      type="submit"
                      className="btn btn-lg sign-in mb-2"
                     
                    >
                      Log in
                    </button>

                    <Link className="forgot-password" to={`/forgotpassword`}>
                      <span className="forget forgotBtn">
                        Forgot your password?
                      </span>
                    </Link>
                    <br />
                  </div>
      <div className="d-flex flex-column pt-2">
        <p className="text-center forget getappointedBtn m-0 ">
          Already have an account
        </p>
        <button
          className="btn btn-lg sign-in mb-2"
          onClick={signIn}
        >
          Sign In
        </button>
      </div>
    </form>
  );
};

export default Login;
